import React from "react";

const Portfolio = () => {
  return (
    <section className="portfolio container">
      <div className="portfolio-itens fresh-smkt coluna">
        <h3>Fresh Supermarket</h3>
        <span>+</span>
      </div>
      <div className="portfolio-itens phone-mockup coluna"></div>
      <div className="portfolio-itens webdesign-trends coluna"></div>
      <div className="portfolio-itens ecommerce-ux coluna"></div>
    </section>
  );
};

export default Portfolio;
